import React from 'react';

const RestaurantManagementPage = () => {
  return (
    <div className="min-h-screen flex">
      {/* Sidebar */}
      <div className="bg-gradient-to-r from-red-500 to-orange-600 text-white w-64 flex-shrink-0">
        {/* Sidebar content here */}
      </div>

      {/* Main Content */}
      <div className="flex-1 p-8 bg-white">
        {/* Restaurant Details */}
        <div className="mb-8">
          <h2 className="text-4xl font-bold mb-4 text-gray-800">Patina Restaurant</h2>
          <p className="text-gray-700">
            A beautiful, modern, and contemporary restaurant in Brisbane’s most iconic heritage listed building, Customs House.
          </p>
          {/* Add more restaurant details as needed */}
        </div>

        {/* Executive Chef and Menus */}
        <div className="mb-8">
          <h3 className="text-2xl font-bold mb-4">Executive Chef & Menus</h3>
          <p className="text-gray-700">
            At the helm of Patina is Executive Chef, John Offenhauser. With his wealth of international experience, Offenhauser has crafted the menus as distinctive as the space itself, featuring appearances from the garden, pasture, sea, and bay.
          </p>
          {/* Add more chef and menu details as needed */}
        </div>

        {/* Cuisine and Top Picks */}
        <div className="mb-8">
          <h3 className="text-2xl font-bold mb-4">Cuisine & Top Picks</h3>
          <p className="text-gray-700">
            Patina’s cuisine is local, farm-to-table-based. The elaborate menu showcases mouth-watering dishes such as Hand Rolled Gnocchi with Grilled Broccoli and Mushroom Cream, WA Scallops with Sweet Potato Puree, and Grilled Mooloolaba Prawns with Green Nam Jim Dressing and Sesame Cucumbers.
          </p>
          {/* Add more cuisine and top picks details as needed */}
        </div>

        {/* Dining Experience */}
        <div className="mb-8">
          <h3 className="text-2xl font-bold mb-4">Dining Experience</h3>
          <p className="text-gray-700">
            For an incredible dining experience with some of the best views in the city, Patina is the eye-catching new restaurant the city has been waiting for. Diners are invited to enjoy fresh seasonal produce and local seafood against the spectacular backdrop of the Brisbane River and Story Bridge.
          </p>
          {/* Add more dining experience details as needed */}
        </div>

        {/* Contact Information */}
        <div className="mb-8">
          <h3 className="text-2xl font-bold mb-4">Contact Information</h3>
          <p className="text-gray-700">For General Enquiries: +61 7 3365 8999</p>
          <p className="text-gray-700">For Restaurant Bookings: +61 7 3365 8921</p>
          <p className="text-gray-700">info@customshouse.com.au</p>
          <p className="text-gray-700">399 Queen St., Brisbane QLD 4000</p>
          {/* Add more contact information as needed */}
        </div>

        {/* About Customs House */}
        <div className="mb-8">
          <h3 className="text-2xl font-bold mb-4">About Customs House</h3>
          <p className="text-gray-700">
            The University of Queensland’s Customs House is one of Brisbane’s premier restaurant, events, and heritage destinations.
          </p>
          {/* Add more about information as needed */}
        </div>
        
        {/* Footer */}
        <div className="mt-8">
          <p className="text-gray-700">Ⓒ 2023 | SITE BY MERGE MARKETING & CREATIVE</p>
        </div>
      </div>
    </div>
  );
};

export default RestaurantManagementPage;
